import "./style.css";


function Tile(props) {
    return (
    <div className="card">
      <div className="img-container">
        <img alt={props.name} src={props.image} className="bookImg" />
      </div>
      {/* <span onClick={() => props.removeTile(props.id)} className="remove">ùòÖ</span> */}
    </div>
    );
};

export default Tile;
